window.bookSummaryJSON = "<p>Twenty-six point two miles isnâ€™t enough anymore. Obstacle course racing, which combines the endurance challenges of a marathon with the mind-bending rigors of overcoming obstacles along the way, is taking the world by storm. At the center of this phenomenon is Joe De Sena, the driving force behind the enormously popular Spartan Race. De Sena offers a simple philosophy: commit to a goal, put in the work, and get it done. From that philosophy, as played out first in his own life and now for millions across trails, through mud, and up mountainsides, Spartan Race was born. Now in <i>Spartan Up!</i> De Sena gives you a life strategy guide that takes you out of your comfort zone and into a combat zone. As he breaks down obstacles from his many races, detailing how each parallels real life experiences, you will learn how to:</p> <ul> <li>Conquer your greatest obstacle - your will</li> <li>Embrace your greatest friend - discipline</li> <li>Make limitations vanish and establish a new normal</li> <li>Achieve the ultimate: obstacle immunity</li> </ul> <p>Other events breed sheep; Spartan Race breeds wolves. </p> <p>Filled with unforgettable stories of Spartan racers as well as hard-won truths learned along the course, <i>Spartan Up!</i> will help anyone reach their full potential - in life, business, relationships, indeed anything one sets out to do. It is the blueprint that takes you right past Go, to your finish line.</p>"; 
